import React, {useState} from 'react'

const TodoList = () => {
  const [todos, setTodos] = useState([])

  return (
    <>
        <div>TodoList</div>
        <input type="text" />
        <button>Add Todo</button>
        <button>Clear Complete</button>
        <div>0  left to do</div>
    </>
  )
}

export default TodoList
